import React from "react";
import './header.css'


function Header() {
  return (
    <div className="header">
      <ul>
        <li></li>
      </ul>
      <a>Home </a>
      <a>Login </a>
      <a>Register </a>
      <a>Portfolio </a>
    </div>
  );
}

export default Header;
